# -- Calculate confidence intervals

tconfintMeans = []
for k in testResults.keys():
  m = sms.DescrStatsW(testResults[k]).tconfint_mean()
  tconfintMeans.append(m[1] - m[0])

print("Confidence intervals:\n", str(tconfintMeans))

# -- Calculate average values

for k in testResults.keys():
  mean = sum(testResults[k]) / len(testResults[k])
  testResults[k] = mean

# print("Test results:\n", str(testResults))
print("Test results:\n", str(testResults))

